INSERT INTO `gym_reviews` (`gym_review_id`, `gym_mark`, `gym_review_descript`, `user_id`, `gym_id`) VALUES
(0, 3, 'Brudno i na salach niezbyt dobrze pachnie...???', 0, 7),
(1, 5, 'Ładna, zadbana siłownia, dużo sprzętu, przemiła obsługa ?.', 1, 7),
(2, 2, 'Mega lans jeśli nie masz obcisłych ciuchów i nie napijesz sobie skarpety w kroku to będziesz poczegany za leszcza???', 2, 6),
(3, 3, 'Szkoda ze tylko abonamenty....?', 3, 1),
(4, 4, 'Fajna siłownia masa sprzętu i maszyn można konkretnie poćwiczyć choć w niektórych godzinach jest naprawdę tłoczno i trzeba czekać aż ktoś skończy lub ćwiczyć na zmianę.', 4, 5),
(5, 3, 'Fajna siłownia, miła obsługa. Trochę mało urządzeń. Fajne zajęcia. Będę musiał tu wrócić.?', 5, 1),
(6, 5, 'Super! Mało osób, czysto, dużo dobrego sprzętu - polecam gorąco ??', 6, 1),
(7, 5, 'Moim zdaniem najlepsza siłownia', 7, 5),
(8, 5, 'Najlepsza i najnowocześniejsza siłownia w okolicy ??.', 8, 5),
(9, 2, 'Nie fjniw i syf', 9, 3),
(10, 5, 'Dużo sprzętu.?? Miła obsługa zawsze gotowa do pomocy. Godziny otwarcia to bajka i to za cenę karnetu w Polsce. Gorąco polecam', 10, 0),
(11, 5, 'Bardzo czysto, przyjemnie, sprzęt zadbany, miła obsługa', 11, 0),
(12, 5, 'Dobry duzy klub z parkingiem. Duza powierzchnia ze sprzetem do treningu silowego jak i kardio.??', 12, 6),
(13, 3, 'Brudno i na salach niezbyt dobrze pachnie...???', 13, 3),
(14, 3, 'Miejsce ok.', 14, 0),
